if __name__ == "__main__":
    parser = argparse.ArgumentParser()

    parser.add_argument("--model_path", default=None, type=str, required=True, help="Path to the model to convert.")
    parser.add_argument("--src_path", default=None, type=str, required=True, help="Path to the original model.")
    parser.add_argument("--checkpoint_path", default=None, type=str, required=True, help="Path to the output model.")

    args = parser.parse_args()

    assert args.model_path is not None, "Must provide a model path!"
    assert args.checkpoint_path is not None, "Must provide a checkpoint path!"
    assert args.src_path is not None, "Must provide a sourcecheckpoint path!"

    diff_pipe = StableDiffusionPipeline.from_pretrained(args.model_path)
    diff_pipe_unet_sd = diff_pipe.unet.state_dict()

    org_model = torch.load(args.src_path)
    org_sd = org_model["state_dict"] if "state_dict" in org_model else org_model

    for ckpt_key, diff_key in KeyMap.items():
        org_sd[ckpt_key] = diff_pipe_unet_sd[diff_key]

    torch.save(org_model, args.checkpoint_path)